import React from "react";
import { Button} from "../App.styled";

const FeedbackOptions = ({onHandleClickGood, onHandleClickNeutral, onHandleClickBad}) => {
    return (
        <div> 
        <Button type="button" onClick={onHandleClickGood}>Good </Button>
        <Button type="button" onClick={onHandleClickNeutral}>Neutral </Button>
        <Button type="button" onClick={onHandleClickBad}>Bad </Button>
        </div>
    )
}

export default FeedbackOptions;
